import logo from "../logo2.png";
import "../App.css";
import { Link } from "react-router-dom";

function Layout(){
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo"/>
        <nav>
          <ul>
            <li></li>
          </ul>
        </nav>
      </header>
      
      <section></section>
      
      <footer></footer>
    </div>
  );
}

export default Layout;
